export default function Times() {
    
    return (
    <div>
        <img src="/assets/clock.png" alt="this is a clock"/>
        <p>Service Times</p>
        <div>
            <p>Monday time to time</p>
            <p>Tuesday time to time</p>
        </div>
    </div>
    );
}
